# -*- coding: utf-8 -*-
from keras import Model,Input
from sklearn.model_selection import train_test_split
import sys
import time
import keras
import random
from keras.datasets import cifar10
import numpy as np
from keras.layers import Conv2D, MaxPooling2D, AveragePooling2D
from keras.layers import Dense, Dropout, Activation, Flatten
from keras.models import Sequential
from keras.optimizers import SGD
from keras.utils import np_utils

(X_train, Y_train), (X_test, Y_test) = cifar10.load_data()  # 32×32
# seeds = []  [525, 630, 140, 289, 6, 999, 414, 710, 34, 823]
DataMiss_Index = []
random.seed(823)
DataMiss_Index = random.sample(range(50000),500)
print(DataMiss_Index)
X_train = np.delete(X_train,DataMiss_Index,axis=0)
Y_train = np.delete(Y_train,DataMiss_Index,axis=0)

X_train = X_train.astype('float32')
X_test = X_test.astype('float32')

X_train /= 255
X_test /= 255

print('Train:{},Test:{}'.format(len(X_train),len(X_test)))

nb_classes=10
# convert integers to dummy variables (one hot encoding)
Y_train = np_utils.to_categorical(Y_train, nb_classes)
Y_test = np_utils.to_categorical(Y_test, nb_classes)
print('data success')


#前面的数据处理没有改。就是按照论文里面的结构搭了一下。

model = Sequential()
model.add(Conv2D(filters=64, kernel_size=(3, 3), activation='relu',padding='valid', input_shape=(32, 32, 3)))
model.add(Conv2D(filters=64, kernel_size=(3, 3), activation='relu',padding='valid'))
model.add(MaxPooling2D(pool_size=(2, 2)))
model.add(Conv2D(filters=128, kernel_size=(3, 3), activation='relu',padding='valid'))
model.add(Conv2D(filters=128, kernel_size=(3, 3), activation='relu',padding='valid'))
model.add(MaxPooling2D(pool_size=(2, 2)))
model.add(Flatten())
model.add(Dense(256, activation='relu'))
model.add(Dense(256, activation='relu'))
model.add(Dense(10, activation='softmax'))
model.summary()


model.compile(loss='categorical_crossentropy', optimizer=keras.optimizers.adam(), metrics=['accuracy'])
model.fit(X_train, Y_train, batch_size=128, epochs=20,verbose=1,shuffle=False) #先不要 shuffle=False
#Y_pred = model.predict_proba(X_test, verbose=0)
score = model.evaluate(X_test, Y_test, verbose=0)
print('测试集 score(val_loss): %.4f' % score[0])
print('测试集 accuracy: %.4f' % score[1])
model.save('ModelC_DM9.hdf5')

